  BrowserRouter as Router,
  Routes,
  Route,
} from 'react-router-dom';
import { HomePage } from './pages/home-page/home-page.js';
import './App.css';

function App() {
  return (

    <Router>
      <div>
        Hello!
      </div>
      <div className="App">
          <Routes>
            <Route>
              <HomePage />
            </Route>
          </Routes>
      </div>
    </Router>
);
}

export default App;
